import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { CapturaComponent } from './captura/captura.component';
import { CounterComponent } from './lista/lista.component';
import { FetchDataComponent } from './evaluacion/evaluacion.component';

@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    CapturaComponent,
    CounterComponent,
    FetchDataComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      { path: '', component: CapturaComponent, pathMatch: 'full' },
      { path: 'lista', component: CounterComponent },
      { path: 'evaluacion', component: FetchDataComponent },
    ])
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
